import './App.css';
import Button from './components/Button';
import { useContext } from 'react';
import { UserContext, UserConextDispatcher } from './contexts/user-context';

function App() {

  const user = useContext(UserContext);
  const {setUser, clearUser} = useContext(UserConextDispatcher);

  console.log(user);

  const handleOnClick = () => {
    console.log('clicked');
    setUser({ name: 'Jane Doe' })
  }

  const handlenClear = () => {
    clearUser();
  }

  return (
    <div className="App">
      <header className="App-header">
        <Button onClick={handlenClear}>Clear user</Button>
        <Button onClick={handleOnClick}>{user.name}</Button>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
